sources.sass/main.scss:
//  
@import url('https://fonts.googleapis.com/css2?family=Open+Sans:wght@400;600;700&family=Raleway:wght@700&display=swap');

@font-face {
  font-family: 'Raleway';
  font-style: normal;
  font-weight: 700;
  src: url('../fonts/Raleway-Bold.woff') format('woff');
}

@import './utils/variables';
@import './utils/placeholders';
@import './utils/mixins';
@import './utils/base';
@import './components/page-header';
@import './components/hero';
@import './components/slider';
@import './components/slider-buttons';
@import './components/about-us';
@import './components/page-prices';
@import './components/advantages';
@import './components/masters';
