sources.sass/utils/_placeholders.scss:
%list {
  padding: 0;
  margin: 0;
  list-style: none;
}

%link {
  color: inherit;
  text-decoration: none;
}

%button {
  border: none;
  border-radius: 4px;
}

%formButton {
  display: inline-block;
  border: 1px solid $accentColor;
  border-radius: 25px;
  font-weight: 600;
  font-size: 12px;
  line-height: 1.3;
  letter-spacing: 0.09em;
  text-transform: uppercase;
  cursor: pointer;
  transition: color $transition, background-color $transition;

  &:hover,
  &:focus,
  &:active {
    color: $contrastColor;
    background-color: $accentColor;
  }
}

sources.sass/utils/_variables.scss:
$accentColor: #ff6c00;
$bgLightColor: #f7f7f7;
$bgHeaderColor: rgba(25, 28, 38, 0.2);
$bgPricesSectColor: #111319;
$bgFooterColor: #191c26;
$contrastColor: #ffffff;
//      
$dashColor: rgba(157, 164, 189, 0.12);
//  ,    
$textTrColor: rgba(157, 164, 189, 0.6);
//    -  
$textTrColorSec: rgba(157, 164, 189, 0.4);
//      
$textColor: #555555;
//      
$secondaryTextColor: #9da4bd;
//,   ,  , , 
$ordinaryColor: #303030;
$textFont: 'Open Sans',
sans-serif;
// 600, 400, 700
$headerFont:'Raleway',
sans-serif;
// 700
$transition: 250ms cubic-bezier(0.4, 0, 0.2, 1);
// Breakpoints
$mobile: 480px;
$tablet: 768px;
$desktop: 1280px;

sources.sass/utils/_base.scss:
body {
