sources.sass/components/_page-header.scss:
.page-header {
  position: relative;
  z-index: 100;
}

.absolute-block {
  position: absolute;
  top: 0;
  right: 0;
  left: 0;
}

//   
.main-nav {
  display: flex;
  align-items: center;
  justify-content: space-between;

  padding-top: 40px;

  @media screen and (min-width: $tablet) {
    justify-content: start;

    padding-top: 32px;
  }
}

//   
.logo {
  @extend %link;
}

.icon-logo {
  color: $contrastColor;
  fill: currentColor;

  @media screen and (min-width: $tablet) {
    color: $ordinaryColor;
  }
}

//   
.menu-button {
  position: relative;
  z-index: 200;

  display: block;
  padding: 0;

  border: none;
  outline: transparent;
  background-color: transparent;

  fill: currentColor;

  cursor: pointer;

  .icon-menu {
    color: $contrastColor;
    transition: color $transition;
  }

  .icon-close {
    display: none;
    color: $ordinaryColor;
    transition: color $transition;
  }

  @media screen and (min-width: $tablet) {
    display: none;
  }
}

.menu-button.is-open {
  .icon-menu {
    display: none;
  }

  .icon-close {
    display: block;
  }
}

//   overlay
.overlay-menu.is-open {
  @media screen and (max-width: $tablet - 1px) {
    position: fixed;
    top: 0;
    left: 0;

    width: 100%;
    height: 100%;

    background-color: $bgHeaderColor;
    box-shadow: 0px 1px 3px rgba(0, 0, 0, 0.16), 0px 2px 4px rgba(0, 0, 0, 0.08), 0px 4px 8px rgba(0, 0, 0, 0.04);
  }
}

//  
.menu-container {
  @media screen and (max-width: $tablet - 1px) {
    position: absolute;
    top: 0;
    right: 0;
    z-index: 100;

    max-width: 337px;
    min-height: 796px;

    padding: 118px 40px;

    background-color: $contrastColor;
    box-shadow: -1px 0px 3px rgba(0, 0, 0, 0.16), -2px 0px 4px rgba(0, 0, 0, 0.08), -4px 0px 8px rgba(0, 0, 0, 0.04);

    opacity: 0;

    transition: opacity $transition;

  }

  @media screen and (min-width: $tablet) {
    display: flex;
    align-items: center;

    margin-left: auto;
  }
}

.menu-container.is-open {
  @media screen and (max-width: $tablet - 1px) {
    opacity: 1;
  }
}

//    
.site-nav {
  @extend %list;

  @media screen and (max-width: $tablet - 1px) {
    margin-bottom: 64px;
  }

  @media screen and (min-width: $tablet) {
    display: flex;
    align-items: center;

    margin-right: 47px;
  }

  @media screen and (min-width: $desktop) {
    margin-right: 322px;
  }

  .link {
    @extend %link;
    display: inline-block;

    font-weight: 600;
    font-size: 18px;
    line-height: 1.39;
    letter-spacing: 0.1em;

    color: $ordinaryColor;

    transition: color $transition;

    @media screen and (min-width: $tablet) {
      color: $contrastColor;
      font-size: 12px;
      line-height: 1.33;
    }

    &:hover,
    &:focus {
      color: $accentColor;
    }
  }

  .item:not(:last-child) {
    @media screen and (max-width: $tablet - 1px) {
      margin-bottom: 24px;
    }

    @media screen and (min-width: $tablet) {
      margin-right: 24px;
    }

    @media screen and (min-width: $desktop) {
      margin-right: 40px;
    }
  }
}

//     
.flex-container {
  @media screen and (min-width: $tablet) 
  and (max-width: $desktop - 1px) {
    display: flex;
    flex-direction: column-reverse;
    align-items: center;
  }

  @media screen and (min-width: $desktop) {
    display: flex;
    align-items: center;
  }
}

//   
.number-phone {
  @extend %link;
  display: inline-block;

  @media screen and (max-width: $tablet - 1px) {
    margin-bottom: 24px;
  }

  font-weight: 600;
  font-size: 18px;
  line-height: 1.39;
  letter-spacing: 0.1em;

  color: $ordinaryColor;

  transition: color $transition;

  @media screen and (min-width: $tablet) {
    color: $contrastColor;
    font-size: 12px;
    line-height: 1.33;
  }

  @media screen and (min-width: $desktop) {
    margin-right: 40px;
  }

  &:hover,
  &:focus {
  color: $accentColor;
  }
}

//   -
.button-record {
  @extend %link;
  @extend %formButton;
  margin-bottom: 64px;
  padding: 12px 36px;
  color: $ordinaryColor;

  @media screen and (min-width: $tablet) {
    margin-bottom: 20px;
    padding: 12px 19px;
    color: $contrastColor;
  }

  @media screen and (min-width: $desktop) {
    margin-bottom: 0;
  }
}

//    
.channel {
  @extend %list;
  display: flex;
  align-items: center;
  flex-wrap: wrap;

  @media screen and (min-width: $tablet) {
    display: none;
  }

  &::before {
    display: block;
    margin-right: 40px;
    content: "";
    width: 60px;
    height: 1px;
    background-color: $ordinaryColor;
  }

  @media screen and (max-width: $tablet - 1px) {
    .item:last-child {
      flex-basis: 100%;
      margin-top: 24px;
      margin-left: 100px;
    }
  }

  .link {
  @extend %link;

  font-weight: 600;
  font-size: 14px;
  line-height: 1.36;

  color: $ordinaryColor;

  transition: color $transition;

  @media screen and (min-width: $tablet) {
    font-size: 11px;
    line-height: 1.36;
    }

  &:hover,
  &:focus {
    color: $accentColor;
    }
  }
}

sources.sass/components/_hero.scss:
.hero-section {
    position: relative;
    width: 100%;
    height: 100%;
    background: linear-gradient( to right, $contrastColor 50%, $bgPricesSectColor 50%);
    overflow: hidden;
    @media screen and (max-width: $tablet - 1px) {
        background: linear-gradient( to right, $bgPricesSectColor, $bgPricesSectColor);
    }
}

.hero-container {
    position: relative;
    height: 580px;
    padding-top: 208px;
    padding-bottom: 183px;
    margin-right: auto;
    margin-left: auto;
    z-index: 2;
    @media screen and (max-width: $tablet - 1px) {
        max-width: $mobile;
    }
    @media screen and (min-width: $tablet) {
        width: $tablet;
        height: 680px;
        padding-top: 272px;
        padding-bottom: 40px;
    }
    @media screen and (min-width: $desktop) {
        width: $desktop;
    }
}

.hero-social-list {
    @extend %list;
    position: absolute;
    bottom: 40px;
    left: 76px;
    display: flex;
    flex-direction: row-reverse;
    align-items: center;
    transform: rotate(-90deg);
    transform-origin: bottom left;
    &::after {
        content: '';
        display: block;
        margin-right: 40px;
        background-color: $ordinaryColor;
        width: 60px;
        height: 1px;
    }
    @media screen and (max-width: $tablet - 1px) {
        display: none;
    }
    @media screen and (min-width: $desktop) {
        left: 90px;
    }
}

.hero-link {
    @extend %link;
    margin-right: 40px;
    color: $ordinaryColor;
    font-weight: 600;
    font-size: 11px;
    line-height: 1.36;
    letter-spacing: 0.2em;
    transition: color $transition, background-color $transition;
    &:hover,
    &:focus,
    &:active {
        color: $accentColor;
    }
}

.hero-box {
    max-width: 306px;
    @media screen and (min-width: $tablet) {
        max-width: 355px;
        margin-left: 240px;
    }
    @media screen and (min-width: $tablet) {
        max-width: 475px;
        margin-left: 200px;
    }
}

.hero-description {
    display: flex;
    align-items: center;
    margin-bottom: 20px;
    color: $textTrColor;
    font-weight: 600;
    font-size: 11px;
    line-height: 1.37;
    letter-spacing: 0.1em;
    text-transform: uppercase;
    &::before {
        content: '';
        margin-right: 20px;
        background-color: $textTrColor;
        width: 60px;
        height: 1px;
    }
}

.hero {
    margin-bottom: 20px;
    font-family: $headerFont;
    color: $contrastColor;
    font-weight: 700;
    font-size: 48px;
    line-height: 1.17;
    letter-spacing: 0.05em;
    @media screen and (min-width: $desktop) {
        font-size: 72px;
        line-height: 1.18;
    }
}

.hero-content {
    font-size: 16px;
    line-height: 1.63;
    color: #9da4bd;
    @media screen and (min-width: $desktop) {
        font-size: 18px;
        line-height: 1.67;
    }
}

sources.sass/components/_slider.scss:
