        color: $contrastColor;
        @media screen and (max-width: 767px) {
            margin-left: auto;
            margin-right: auto;
        }
    }
    textarea {
        resize: none;
        height: 75px;
        width: 100%;
        background: border-box;
        border-top: none;
        border-left: none;
        border-right: none;
        border-bottom-color: rgba(157, 164, 189, 0.4);
    }
}

.clients-form>h2,
.contacts>h2 {
    margin-bottom: 40px;
    font-family: Raleway;
    font-weight: 700;
    font-size: 42px;
    line-height: 1.17;
    letter-spacing: 0.05em;
    color: $contrastColor;
    @media screen and (max-width: 767px) {
        text-align: center;
    }
}

.form-field-item,
.form-field-textarea {
    position: relative;
    &:hover>.form-label,
    &:focus>.form-label,
    &:hover>.form-label-message,
    &:focus>.form-label-message {
        color: $contrastColor;
    }
    &:hover>.form-label,
    &:focus>.form-label {
        transform: translateY(-40px);
    }
    &:hover>.form-label-message,
    &:focus>.form-label-message {
        transform: translateY(-23px);
    }
    &:hover .form-input,
    &:focus .form-input {
        border-bottom-color: $contrastColor;
    }
    @media screen and (max-width: 1279px) {
        display: flex;
        &:not(:last-of-type) {
            margin-bottom: 36px;
        }
    }
    .form-input,
    textarea {
        padding: 8px 0;
        width: 100%;
        border-top: none;
        border-left: none;
        border-right: none;
        border-bottom-color: rgba(157, 164, 189, 0.4);
        border-width: 1px;
        color: $contrastColor;
        font-weight: 600;
        letter-spacing: 0.07em;
        background-color: $bgFooterColor;
        transition: border-bottom-color $transition;
        cursor: pointer;
        &:focus {
            outline: none;
        }
        &:not(:placeholder-shown)+.form-label,
        &:not(:placeholder-shown)+.form-label-message {
            color: $contrastColor;
        }
        &:invalid:not(:placeholder-shown) {
            border-color: $accentColor;
            &+.form-label {
                color: $accentColor;
            }
        }
        &:not(:placeholder-shown)+.form-label {
            transform: translateY(-40px);
        }
        &:not(:placeholder-shown)+.form-label-message {
            transform: translateY(-23px);
        }
    }
    .form-label,
    .form-label-message {
        position: absolute;
        top: 50%;
        left: 0;
        font-weight: 600;
        font-size: 11px;
        line-height: 1.36;
        letter-spacing: 0.1em;
        text-transform: uppercase;
        color: rgba(157, 164, 189, 0.4);
        transform: translateY(-50%);
        transition: color $transition, transform $transition;
    }
    .form-label-message {
        top: 0;
        transform: translateY(0);
    }
}

.form-field-item {
    @media screen and (min-width: $desktop) {
        width: calc((100% / 2) - 30px);
    }
}

.form-field-textarea {
    display: flex;
}

@media screen and (min-width: $tablet) and (max-width: 1279px) {
    .contacts-block {
        display: flex;
        justify-content: space-between;
    }
}

// 
// 
.contacts {
    @media screen and (max-width: 1279px) {
        padding-top: 100px;
    }
    @media screen and (max-width: 767px) {
        padding-top: 84px;
    }
}

.contacts address {
    @media screen and (max-width: $tablet) {
        margin-bottom: 44px;
    }
    @media screen and (min-width: $desktop) {
        margin-bottom: 70px;
    }
    ul {
        @extend %list;
    }
    .contacts-address-button {
        padding-left: 0;
        padding-right: 0;
    }
    li:hover>a,
    li:focus>a,
    li:hover>.contacts-address-button,
    li:focus>.contacts-address-button {
        color: $contrastColor;
        cursor: pointer;
    }
    li:hover svg,
    li:focus svg {
        --color2: #ffffff;
    }
    li:not(:last-child) {
        margin-bottom: 20px;
        a {
            text-decoration: none;
        }
    }
    a,
    .contacts-address-button {
        display: flex;
        align-items: center;
        font-style: normal;
        font-size: 18px;
        line-height: 1.7;
        color: $secondaryTextColor;
        transition: color $transition;
    }
    .contacts-address-button {
        background-color: inherit;
        outline: none;
        border: none;
    }
    svg {
        margin-right: 16px;
        // transition: fill $transition;
    }
}

//  
.working-hours {
    &-header {
        display: flex;
        align-items: center;
        margin-bottom: 20px;
        .strip {
            width: 60px;
            height: 1px;
            margin-right: 20px;
            background-color: $textTrColor;
        }
    }
    h3 {
        font-weight: 600;
        font-size: 11px;
        line-height: 15px;
        letter-spacing: 0.1em;
        text-transform: uppercase;
        color: $contrastColor;
    }
    p {
        font-size: 18px;
        line-height: 30px;
        color: $secondaryTextColor;
    }
}

sources.sass/components/_footer.scss:
.page-footer {
  padding-top: 44px;
  padding-bottom: 44px;

  font-weight: 600;
  font-size: 11px;
  line-height: 1.36;

  @media screen and (min-width: $tablet) {
    padding-top: 56px;
    padding-bottom: 56px;
  }

  .container {
    display: flex;
    flex-grow: 1;
    justify-content: space-between;
  }
}

.copyright {
  display: flex;
  align-items: center;
  color: $secondaryTextColor;
  letter-spacing: 0.2em;

  @media screen and (max-width: $tablet - 1px) {
    margin-top: 35px;
  }

  & > svg {
    margin-right: 6px;
  }
}

.page-footer-list {
  display: flex;
  justify-content: space-between;
  align-items: center;
  @extend %list;
  width: 270px;

  @media screen and (max-width: $mobile) {
    align-self: baseline;
  }

  & > .strip {
    width: 60px;
    height: 1px;
    background-color: $ordinaryColor;
  }

  a {
    color: $ordinaryColor;
    text-decoration: none;
    transition: color $transition;

    &:hover,
    &:focus {
      color: $accentColor;
    }
  }
}

sources.sass/components/_modal-map.scss:
.backdrop {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background-color: rgba(255, 108, 0, 0.9);
  transition: opacity $transition;
  overflow: hidden;

  &.is-hidden {
    opacity: 0;
    pointer-events: none;
  }
}

body.modal-open {
  overflow: hidden;
}

.modal {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  background-color: #fff;
}

.map-close {
  position: absolute;
  display: flex;
  justify-content: center;
  align-items: center;
  z-index: 10;
  top: 8px;
  right: 8px;

  width: 30px;
  height: 30px;
  margin: 0;
  padding: 0;
  border: 1px solid $textColor;
  border-radius: 50%;
  cursor: pointer;

  &:hover .icon-close,
  &:focus .icon-close {
    fill: $accentColor;
  }

  &:hover,
  &:focus {
    border-color: $accentColor;
  }
}

.modal {
  width: 70%;
  height: 70%;
  border-radius: 4px;
  overflow: hidden;
}

.map-container {
  width: 100%;
  height: 100%;
}

.map-frame {
  width: 100%;
  height: 100%;
}
